import React from 'react';
import Card from '../Card';

const MathCard: React.FC = () => {
    const title = "Mathematical Operations";
    const content = (
        <div>
            <h3>Functions:</h3>
            <ul>
                <li><strong>add:</strong> Adds two numbers.</li>
                <li><strong>subtract:</strong> Subtracts one number from another.</li>
                <li><strong>multiply:</strong> Multiplies two numbers.</li>
                <li><strong>divide:</strong> Divides one number by another.</li>
            </ul>
            <h3>Examples:</h3>
            <p>add(2, 3) = {2 + 3}</p>
            <p>subtract(5, 2) = {5 - 2}</p>
            <p>multiply(4, 3) = {4 * 3}</p>
            <p>divide(10, 2) = {10 / 2}</p>
        </div>
    );

    return <Card title={title} content={content} />;
};

export default MathCard;
